import React from 'react';

interface Props {
  items: string[];
  onDelete: (index: number) => void;
}

function ToDoListItem({ items, onDelete }: Props) {
  return (
    <div>
      <h2>ToDo List</h2>
      <ul>
        {items.map((item, index) => (
          <li key={index}>
            {item} <button onClick={() => onDelete(index)}>Elimina</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ToDoListItem;
